def dmota(tp,fp,fn,thr):
    dmota=[]
    maxdmota = -100
    maxthr=0
    for i in range(len(thr)):
        mo=1-(fp[i]+fn[i])/(tp[i]+fn[i])
        if mo >maxdmota:
            maxdmota = mo
            maxthr=thr[i]
        dmota.append(mo)
    return dmota,round(maxthr,2),round(maxdmota, 2)#保留两位小数


